@EndUserText.label: 'BP type adaptations'
@Metadata.allowExtensions: true
define root view entity ZETR_DDL_I_BP_TYP
  as select from    zetr_t_exp116                                                      as Main
    left outer join DDCDS_CUSTOMER_DOMAIN_VALUE_T( p_domain_name: 'ZETR_D_PRTTY_EXP' ) as PartnerType on  PartnerType.language  = $session.system_language
                                                                                                      and PartnerType.value_low = Main.prtty

  /* left outer join I_BPIdentificationTypeText                                     as BPIdentificationText on  BPIdentificationText.BusinessPartnerLanguage = $session.system_language
                                                                                                          and BPIdentificationText.BPIdentificationType    = Main.relpr
*/


{
      @ObjectModel.text.element: [ 'PartnerTypeText' ]
  key Main.prtty       as Prtty,
  key Main.relpr       as Relpr,
      PartnerType.text as PartnerTypeText
}
